                    <div className="services-desc-price__single-row">
                        <span>Oprowadzki konne na kucach i koniach</span>
                        <span>50zł/h</span>
                    </div>
                    <span className="gold-line"></span>


                </div>


                <div className="picture-container picture-container--size">
                    <img src={ OfferImg } alt="about" />
                </div>
            </div>
        </section>
    );
}
